  false,\n\t\"url\": null,\n\t\"notes\": \"Proposal for a study at Des Lacs National
  Wildlife Refuge and Lostwood National Wildlife Refuge to attempt to understand the
  mechanisms of ecological isolation of five species of grebes in the area. The objectives
  of the proposed study are to: (1) record habitat preferences exhibited by the five
  species of grebes of northwestern North Dakota; (2) observe behavioral traits such
  as aggression and territoriality that may affect or by affected by the habitats
  used; (3) observe foods and feeding methods of the grebes; and (4) attempt to pool
  the above observations with known species characteristics (e.g size and range) to
  determine the amount of competition between the species and (assuming interspecific
  competition) the mechanisms by which the species are ecologically isolated and thus
  able to coexist on the glaciated prairies.  This proposal was submitted by Princeton
  University.  The final report from the project is to be completed by mid-summer,
  1973.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
